import React from 'react'
import ReactDOM from 'react-dom'

const Header = () =>{
  const heading = "Half Stack Application developement"
  return(
  <div>
    <h1>{heading}</h1>
  </div>
  )
}

const Part = (props) =>{
  const part1 = 'Fundamentals of React'
  const exercises1 = 10
  const part2 = 'Using props to pass data'
  const exercises2 = 7
  const part3 = 'State of a component'
  const exercises3 = 14
  return(
    <div><p>{props.part} {props.exercise}</p></div>
  )
}

const Content = () =>{
return(
    <div>
      <Part part='Fundamentals of React' exercise = "10"/>
      <Part part= 'Using props to pass data' exercise = "7"/>
      <Part part='State of a component' exercise = "14"/>
    </div>
  )
}

const Total = () =>{
  const total = 31
  return(
    <div>
      <p>Number of exercises {total}</p>
    </div>
  )
}

const App = () => {
  return (
    <div>
      <Header />
      <Content />
      <Total />
    </div>
  )
}

ReactDOM.render(<App />, document.getElementById('root'))
